class Solution():
	#	recursive solution
	#	this will TLE unless you use a buffer
	def isMatch(self, string, pattern):
		if string and not pattern:
			return False

		if not string and pattern and pattern!='*':
			return False

		if string==pattern or len(string)==1 and pattern=='?' or pattern=='*':
			return True

		if pattern[0]=='?' or pattern[0]==string[0]:
			return self.isMatch(string[1:], pattern[1:])
		elif pattern[0]=='*':
			for i in xrange(len(string)):
				if self.isMatch(string[i:], pattern[1:]):
					return True
			return False
		else:
			return false




	def isMatchOld(self, string, pattern):
		lenPattern=len(pattern)
		lenString=len(string)

		k=0
		for c in pattern:
			if c!='*':
				k=k+1
		if k > lenString:
			return False


		currentLine, lastLine=[0]*(lenString+1), [0]*(lenString+1)
		lastLine[0]=1

		for i in range(lenPattern):

			if pattern[i]=='?':
				
				for j in range(1, lenString+1):
					if lastLine[j-1]==1:
						currentLine[j]=1

			elif pattern[i]=='*':
				j=0
				while(j<=lenString and lastLine[j]!=1):
					j=j+1
				if j <= lenString:
					for k in range(j, lenString+1):
						currentLine[k]=1 

			else:
				for j in range(1, lenString+1):
					if lastLine[j-1]==1 and string[j-1]==pattern[i]:
						currentLine[j]=1

			lastLine=currentLine
			currentLine=[0]*(lenString+1)

		return True if lastLine[lenString]==1 else False


